import React from 'react'

import tourData from '../assets/data/tours.js'
import TourCard from '../shared/TourCard'
import { Col } from 'reactstrap'
import useFetch from '../hooks/usefetch.js'
import { BASE_URL } from '../utils/config.js'



const FeatureTourList = () => {

const {data: featuredTours} = useFetch('${BASE_URL}/tours/search/getFeaturedTours')
console.log(featuredTours)
  
  return (<>
    {featuredTours.map((tour)=>{
          return(
              <Col lg='3' className='mb-4' key={tour._id}><TourCard tour={tour}/></Col>
            
        )})
    }
  </>
  )
}

export default FeatureTourList
